(63, 1, '2022-08-24 14:35:37', '2022-08-24 14:35:37', '<!-- wp:heading {\"level\":3} -->\n<h3>Poslastičarnica Slatka kuća je umetnička radionica za izradu kolača, torti i raznih poslastica sa tradicijom koju gradimo od 2000. godine.</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Tim vrhunskih majstora poslastičara i umetnika dekoratera će se potruditi da ispuni sve vaše svakodnevne slatke želje, kao i one posebne da biste obeležili važne datume vašim životima.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Domaći, tradicionalni recepti, najkvalitetnije domaće i uvozne sirovine i ručna izrada su naše obeležje i garancija kvaliteta.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Spajamo najsavremeniju tehnologiju sa tradicionalnim načinima pravljenja poslastica da bismo stalno napredovali, a naše torte i kolači postajali sve bolji i ukusniji. Zato pratimo najnovije trendove i učimo od najboljih svetskih poslastičara da bi ispunili sve vase slatke želje i maštarije.</p>\n<!-- /wp:paragraph -->', 'Poslastičarnica', '', 'publish', 'closed', 'closed', '', 'poslasticarnica', '', '', '2022-08-24 14:35:37', '2022-08-24 14:35:37', '', 0, 'http://localhost:8081/wp_sajt/?p=63', 0, 'post', '', 0),
