(85, 1, '2022-08-24 15:35:47', '2022-08-24 15:35:47', '<!-- wp:paragraph -->\n<p>Dostava se obavlja rashlađenim vozilima svaki dan od 7:00 do 21.00h.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dostava se dogovara prilikom porudžbine, a najmanje 1 sat ranije za Beograd ili 6 sati van Beograda.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dostava u restorane i na kućnu adresu se obavlja uz toleranciju 1 sat.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Teritorija koju pokrivamo sa dostavom je u krugu stotinjak kilometara od Beograda.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>DOSTAVA TORTI I POSLASTICA:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>za Beograd – Besplatno na željenu adresu (minimum 1000 din)<br>van Beograda – Besplatno na željenu adresu (minimum 6000 din)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ukoliko tortu ili poslastice preuzimate i transportujete automobilom dalje, preporučuje se da tortu transportujete automobilom koji ima klima uređaj. Ne brinite se, torta nije sladoled da će se tako brzo istopiti. Gotova torta je čvrsta, ali ipak ne treba da se izlaže preteranoj toploti. Ovo važi i za mesto gde se torta smešta kada stigne tamo gde je slavlje a najbolje je da bude u frižideru.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Vozite polako kada tortu smestite u automobil, bez naglih polazaka, prelaženja preko rupa, oštrih ulaženja u krivine, kočenja…</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Ne preporučujemo da torte smeštate na sedište vašeg automobila jer u slučaju naglog kočenja može da sklizne i spadne.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Nikako ne ostavljajte tortu u parkiranom automobilu na suncu bez obzira na godišnje doba.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sva naša ambalaža i pakovanje se ne doplaćuju.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Torte su na kartonskim plastificiranim tacnama zapakovane u plastificiranim kutijama od hromokartona.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Molimo Vas da kutiju otvarate tako što će te otvoriti samo jednu stranu i tortu zajedno sa tacnom kao fioku izvučete napolje. Tako će te izbeći oštećenja torte a kutiju će te moći ponovo da iskoristite ako Vam zatreba da ostatak ponesete posle proslave.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":84,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/ANCI-kutija-otvaranje.jpg.webp\" alt=\"\" class=\"wp-image-84\"/></figure>\n<!-- /wp:image -->', 'Dostava', '', 'inherit', 'closed', 'closed', '', '44-revision-v1', '', '', '2022-08-24 15:35:47', '2022-08-24 15:35:47', '', 44, 'http://localhost:8081/wp_sajt/?p=85', 0, 'revision', '', 0),
(89, 1, '2022-08-24 15:57:54', '2022-08-24 15:57:54', '<!-- wp:paragraph -->\n<p>Ukoliko ste vredni, odgovorni, ambiciozni i želite da se priključite timu jedne od najboljih poslastičarnica u Srbiji i regionu, ako imate iskustva u poslastičarstvu ili želite da ga nadogradite i učite uz vrhunske majstore, naša slatka radionica pravo je mesto za vaš profesionalni napredak.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pogledajte ponudu otvorenih mesta za posao u poslastičarnici Slatka kuća i pridružite se našem profesionalnom timu!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Mi nudimo:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Rad u stabilnoj i perspektivnoj firmi</li><li>Kreativan I dinamičan rad u timu vrhunskih majstora poslasičara</li><li>Puno radno vreme</li><li>Stalan i siguran posao, organizovan u 2 smene</li><li>Priliku za sticanje iskustva i znanja</li><li>Mogućnost kontinuiranog učenja i napredovanja</li><li>Dinamično i prijatno radno okruženje u kome ćete dobiti podršku od starta</li><li>Stimulativni bonusi za ostvarene rezultate I redovna isplata zarada</li><li>Atraktivna ponuda plate i benefita</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"style\":{\"color\":{\"background\":\"#fafbe7\"}}} -->\n<div class=\"wp-block-column has-background\" style=\"background-color:#fafbe7\"><!-- wp:paragraph {\"style\":{\"color\":{\"background\":\"#dfdb9d\"}},\"textColor\":\"vivid-red\"} -->\n<p class=\"has-vivid-red-color has-text-color has-background\" style=\"background-color:#dfdb9d\"><strong>PRODAVAC</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Potrebne kvalifikacije:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Srednja stručna sprema, minimum IV stepen</li><li>Poznavanje rada na računaru</li><li>Radno iskustvo u prodaji</li><li>Poželjno poznavanje engleskog jezika</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"style\":{\"color\":{\"background\":\"#fafbe7\"}}} -->\n<div class=\"wp-block-column has-background\" style=\"background-color:#fafbe7\"><!-- wp:paragraph {\"style\":{\"color\":{\"background\":\"#dfdb9d\"}},\"textColor\":\"vivid-red\"} -->\n<p class=\"has-vivid-red-color has-text-color has-background\" style=\"background-color:#dfdb9d\"><strong>DOSTAVLJAČ</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p class=\"has-text-align-left\">Potrebne kvalifikacije:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>vozačka dozvola B kategorije I iskustvo u upravljanju od najmanje 10 godina</li><li>dobro poznavanje šire teritorije Beograda</li><li>Poznavanje korišćenja aplikacije za navigacuju automobila</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"style\":{\"color\":{\"background\":\"#fafbe7\"}}} -->\n<div class=\"wp-block-column has-background\" style=\"background-color:#fafbe7\"><!-- wp:paragraph {\"style\":{\"color\":{\"background\":\"#dfdb9d\"}},\"textColor\":\"vivid-red\"} -->\n<p class=\"has-vivid-red-color has-text-color has-background\" style=\"background-color:#dfdb9d\"><strong>MAJSTOR POSLASTIČAR</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Potrebne kvalifikacije:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Srednja stručna sprema, minimum IV stepen</li><li>Iskustvo u samostalnom pravljenju poslastica minimum 5 godina</li><li>Poznavanje rada na računaru</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"style\":{\"color\":{\"background\":\"#fafbe7\"}}} -->\n<div class=\"wp-block-column has-background\" style=\"background-color:#fafbe7\"><!-- wp:paragraph {\"style\":{\"color\":{\"background\":\"#dfdb9d\"}},\"textColor\":\"vivid-red\"} -->\n<p class=\"has-vivid-red-color has-text-color has-background\" style=\"background-color:#dfdb9d\"><strong>POSLASTIČAR</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Potrebne kvalifikacije:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Srednja stručna sprema, minimum III stepen</li><li>Iskustvo u pravljenju poslastica minimum 2 godine</li><li>Poznavanje rada na računaru</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"style\":{\"color\":{\"background\":\"#fafbe7\"}}} -->\n<div class=\"wp-block-column has-background\" style=\"background-color:#fafbe7\"><!-- wp:paragraph {\"style\":{\"color\":{\"background\":\"#dfdb9d\"}},\"textColor\":\"vivid-red\"} -->\n<p class=\"has-vivid-red-color has-text-color has-background\" style=\"background-color:#dfdb9d\"><strong>POSLASTIČAR DEKORATER</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Potrebne kvalifikacije:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Srednja stručna sprema, minimum III stepen</li><li>Smisao I talenat za dekorisanje</li><li>Poznavanje rada na računaru#fafbe7</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"style\":{\"color\":{\"background\":\"#fafbe7\"}}} -->\n<div class=\"wp-block-column has-background\" style=\"background-color:#fafbe7\"><!-- wp:paragraph {\"style\":{\"color\":{\"background\":\"#dfdb9d\"}},\"textColor\":\"vivid-red\"} -->\n<p class=\"has-vivid-red-color has-text-color has-background\" style=\"background-color:#dfdb9d\"><strong>POSLASTIČAR UMETNIK</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Potrebne kvalifikacije:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Srednja stručna sprema, minimum III stepen</li><li>Talenat za crtanje I vajanje</li><li>Smisao za dekorisanje</li><li>Poznavanje rada na računaru</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"style\":{\"color\":{\"background\":\"#fafbe7\"}}} -->\n<div class=\"wp-block-column has-background\" style=\"background-color:#fafbe7\"><!-- wp:paragraph {\"style\":{\"color\":{\"background\":\"#dfdb9d\"}},\"textColor\":\"vivid-red\"} -->\n<p class=\"has-vivid-red-color has-text-color has-background\" style=\"background-color:#dfdb9d\"><strong>&nbsp;POMOĆNI POSLASTIČAR</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Potrebne kvalifikacije:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Osnovna stručna sprema, I stepen</li><li>Smisao I talenat za rad u kuhinji i proizvodnji hrane</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"style\":{\"color\":{\"background\":\"#fafbe7\"}}} -->\n<div class=\"wp-block-column has-background\" style=\"background-color:#fafbe7\"><!-- wp:paragraph {\"style\":{\"color\":{\"background\":\"#dfdb9d\"}},\"textColor\":\"vivid-red\"} -->\n<p class=\"has-vivid-red-color has-text-color has-background\" style=\"background-color:#dfdb9d\"><strong>POMOĆNI RADNIK</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Potrebne kvalifikacije:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Osnovna stručna sprema, I stepen</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'Posao', '', 'inherit', 'closed', 'closed', '', '50-revision-v1', '', '', '2022-08-24 15:57:54', '2022-08-24 15:57:54', '', 50, 'http://localhost:8081/wp_sajt/?p=89', 0, 'revision', '', 0),
(91, 1, '2022-08-24 16:03:03', '2022-08-24 16:03:03', '<!-- wp:paragraph -->\n<p>Torte, kolače i sve druge poslastice izrađujemo po domaćim i tradicionalnim receptima koristeći najkvalitetnije i najfinije domaće i uvozne sirovine koje su uz ručnu izradu naših veštih poslastičara garancija kvaliteta.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Svakim danom trudimo se da budemo još bolji, a torte i kolači još ukusniji pa spajamo najmoderniju tehnologiju sa tradicionalnim načinima pravljenja poslastica.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Naš tim je sastavljen od vrhunskih majstora koji se svakodnevno usavršavaju da bismo za vas stvarali magične slatkiše koji se pamte do kraja života.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Da bismo ispunili sve vaše slatke maštarije, pratimo najnovije trendove, usavršavamo se i učimo od najboljih svetskih poslastičara.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Torte, kolače i druge slatkiše pravimo u skladu sa vašim željama i potrebama, uz stručne savete naših poslastičara i dekoratera koji će vam u svakom trenutku objasniti sve što vas interesuje.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ukoliko ste ljubitelji domaćih ukusa kolača i torti, poslastičarnica Slatka kuća pravo je mesto za prepuštanje slatkim zadovoljstvima.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ko jednom dođe i proba našu slatku ponudu, vraća se po još!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Za vas stvaramo jestiva umetnička dela i slatke uspomene. Posetite nas na adresi Jove Ilića 15 u Beogradu. Obećavamo da ćete se oduševiti.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Vaša poslastičarnica „Slatka kuća“.</p>\n<!-- /wp:paragraph -->', 'O nama', '', 'inherit', 'closed', 'closed', '', '48-revision-v1', '', '', '2022-08-24 16:03:03', '2022-08-24 16:03:03', '', 48, 'http://localhost:8081/wp_sajt/?p=91', 0, 'revision', '', 0),
