\" alt=\"\" class=\"wp-image-122\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Tri sočne čokoladne korice – čokoladni krem – sloj topljene čokolade –između beli šlag</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3} -->\n<h3>Banana Torta</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":123,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/banana.png\" alt=\"\" class=\"wp-image-123\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Tri korice od belanaca i oraha, filovane vanil kremom sa dodatkom oraha i bele čokolade i laganim vanil kremom sa seckanim bananama. Dekoracija može biti samo šlag</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'Torte', '', 'inherit', 'closed', 'closed', '', '46-revision-v1', '', '', '2022-08-24 16:55:00', '2022-08-24 16:55:00', '', 46, 'http://localhost:8081/wp_sajt/?p=124', 0, 'revision', '', 0);
