(138, 1, '2022-08-24 17:19:39', '2022-08-24 17:19:39', '<!-- wp:cover {\"url\":\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/anci-shop-bg-1-1024x330.jpg\",\"id\":97,\"dimRatio\":10,\"minHeight\":270,\"minHeightUnit\":\"px\",\"isDark\":false,\"style\":{\"color\":{}}} -->\n<div class=\"wp-block-cover is-light\" style=\"min-height:270px\"><span aria-hidden=\"true\" class=\"wp-block-cover__background has-background-dim-10 has-background-dim\"></span><img class=\"wp-block-cover__image-background wp-image-97\" alt=\"\" src=\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/anci-shop-bg-1-1024x330.jpg\" data-object-fit=\"cover\"/><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"left\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-left has-large-font-size\"><strong>Torte su ručno izrađene. </strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-left has-large-font-size\"><strong>Slika torte je informativnog karaktera i odnosi se na standardan oblik i visinu parčeta torte od 8cm.</strong></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"fontSize\":\"medium\"} -->\n<h3 class=\"has-medium-font-size\">Kidy Torta</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":109,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/kidy-bueno.png\" alt=\"\" class=\"wp-image-109\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Četiri tanke bele kore sa lešnikom – svaka premazana nougat kremom – vanil krem sa lešnikom i čoko krem naizmenično</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"fontSize\":\"medium\"} -->\n<h3 class=\"has-medium-font-size\">Kapri Torta</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":113,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/kapri.png\" alt=\"\" class=\"wp-image-113\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Tri lagane, bele kore – na svaku bogat fil od jagoda -lagan vanil krem – sloj topljene čokolade. Dekoracija može biti samo šlag ili čoko glazura</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"fontSize\":\"medium\"} -->\n<h3 class=\"has-medium-font-size\">Mocart Torta</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":114,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/mocart.png\" alt=\"\" class=\"wp-image-114\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Dve sočne čokoladne korice u kombinaciji sa tri krema izuzetnih ukusa: Praline noiset, crna čokolada i pistachio chococream. Dekoracija: šlag, neutro gel, muzički simbol od čokolade. </p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"fontSize\":\"medium\"} -->\n<h3 class=\"has-medium-font-size\">Najlon Torta</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":115,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/Najlon.png\" alt=\"\" class=\"wp-image-115\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Tri lagane kore od belanaca – vanil krem sa seckanim krem bananicama, čoko i vanil krem sa mlevenim plazma keksom</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"fontSize\":\"medium\"} -->\n<h3 class=\"has-medium-font-size\">Baron Torta</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":121,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/baron.png\" alt=\"\" class=\"wp-image-121\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Četiri tanke čokoladne kore natopljene italijanskom tečnom čokoladom , preko svake bogat fil od maline, na njega čokoladni krem. Preporuka za dekoraciju: Čoko glazura</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"fontSize\":\"medium\"} -->\n<h3 class=\"has-medium-font-size\">Badem Torta</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":120,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/badem-1.png\" alt=\"\" class=\"wp-image-120\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Tri korice sa bademom – čoko krem sa seckanom belom čokoladom i seckanim pečenim bademom</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"fontSize\":\"medium\"} -->\n<h3 class=\"has-medium-font-size\">Afrika Torta</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":122,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/afrika.png\" alt=\"\" class=\"wp-image-122\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Tri sočne čokoladne korice – čokoladni krem – sloj topljene čokolade –između beli šlag</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"fontSize\":\"medium\"} -->\n<h3 class=\"has-medium-font-size\">Banana Torta</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":123,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/banana.png\" alt=\"\" class=\"wp-image-123\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Tri korice od belanaca i oraha, filovane vanil kremom sa dodatkom oraha i bele čokolade i laganim vanil kremom sa seckanim bananama. Dekoracija može biti samo šlag</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"fontSize\":\"medium\"} -->\n<h3 class=\"has-medium-font-size\">Black Forest Torta</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":132,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/blek-forest.png\" alt=\"\" class=\"wp-image-132\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Tri lagane kore sa kakao-om obostrano premazane italijanskom tečnom čokoladom , na prvu i treću bogat fil od kupine, preko čokoladni krem, a na drugu koru – bogat fil od maline, preko njega sloj čoko listića i čokoladni krem</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"fontSize\":\"medium\"} -->\n<h3 class=\"has-medium-font-size\">Boem Torta</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":133,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/boem.png\" alt=\"\" class=\"wp-image-133\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Tri kore od belanaca, kakaa i seckanog lešnika – na svaku vanil krem i preko njega čokoladni krem</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"fontSize\":\"medium\"} -->\n<h3 class=\"has-medium-font-size\">Čokoladni Tart</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":134,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/cokoladni-tart.png\" alt=\"\" class=\"wp-image-134\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Sočna torta od belgijske čokolade, punjena termostabilnim čokoladnim kremom i prelivena čokoladnim ganašom. Poručuje se u standardnoj veličini i obliku</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"fontSize\":\"medium\"} -->\n<h3 class=\"has-medium-font-size\">Jaffa Torta</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":135,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wp_sajt/wp-content/uploads/2022/08/jaffa.png\" alt=\"\" class=\"wp-image-135\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Tri kore sa orahom premazane pomorandža nadevom – čoko krem – Jaffa® keks umočen u sok od pomorandže – vanil krem sa jafa keksom</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'Torte', '', 'inherit', 'closed', 'closed', '', '46-revision-v1', '', '', '2022-08-24 17:19:39', '2022-08-24 17:19:39', '', 46, 'http://localhost:8081/wp_sajt/?p=138', 0, 'revision', '', 0),
