Banana Torta                                                                                                                            <strong>190 din/kom</strong></td></tr><tr><td class=\"has-text-align-left\" data-align=\"left\">Black Forest Torta                                                                                                                    <strong>190 din/kom</strong></td></tr><tr><td class=\"has-text-align-left\" data-align=\"left\">Boem Torta                                                                                                                              <strong>190 din/kom</strong></td></tr><tr><td class=\"has-text-align-left\" data-align=\"left\">Čokoladni Tart                                                                                                                          <strong>190 din/kom</strong></td></tr><tr><td class=\"has-text-align-left\" data-align=\"left\">Jaffa Torta                                                                                                                                <strong>190 din/kom</strong></td></tr><tr><td class=\"has-text-align-left\" data-align=\"left\">Čizkejk Malina                                                                                                                          <strong>190 din/kom</strong></td></tr><tr><td class=\"has-text-align-left\" data-align=\"left\">Čizkejk sa Oreo keksom                                                                                                           <strong>190 din/kom</strong></td></tr><tr><td class=\"has-text-align-left\" data-align=\"left\">Čizkejk Šumska Jagoda                                                                                                            <strong>190 din/kom</strong></td></tr><tr><td class=\"has-text-align-left\" data-align=\"left\">Čizkejk Šumsko Voće                                                                                                               <strong>190 din/kom</strong